import { AppBar, Box, ThemeProvider, Typography, createTheme } from '@mui/material';
import './styles.css';

const defaultTheme = createTheme();

export function Header() {
    return(
        <ThemeProvider theme={defaultTheme}>
            <Box sx={{ display: 'flex' }}>
                <Typography
                    component="h1"
                    variant='h6'
                    color='inherit'
                    noWrap
                    sx={{ flexGrow: 1 }}
                >
                    App Name
                </Typography>
            </Box>
        </ThemeProvider>
    )
}
